import {
  AppBar,
  Toolbar,
  Button,
  Typography,
  makeStyles,
  Grid,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  title: {
    flexGrow: 1,
  },
}));

const Header = () => {
  const classes = useStyles();

  return (
    <AppBar position="sticky">
      <Toolbar>
        <Grid container>
          <Grid item lg={1}></Grid>

          <Grid container item lg={10}>
            <Grid item lg={1}></Grid>
            <Typography variant="h6" className={classes.title}>
              Tracthon
            </Typography>

            <Button edge="end" color="inherit">
              Login
            </Button>
          </Grid>

          <Grid item lg={1}></Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
